import { createRouter, createWebHistory } from 'vue-router';
import HomeView from '../views/HomeView.vue';
import HomeInventario from '../views/HomeInventario.vue';
import CrearInventario from '../views/CrearInventario.vue';
import EditartInventario from '../views/EditarInventario.vue';

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/homeinventario',
    name: 'homeinv',
    component: HomeView
  },
  {
    path: '/crearinventario',
    name: 'crearinv',
    component: CrearInventario
  },
  {
    path: '/editarinventario',
    name: 'editarinv',
    component: EditartInventario
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
